import React from 'react';
import './navBar.css';

function Nav() {
    return (
        <div className="nav-bar">
            <ul className="socials-container">
                <li><a href="https://github.com/DandreCampbell" className="fab fa-github social-icon"></a></li>
                <li><a href="https://www.linkedin.com/in/dandre-campbell/" className="fa fa-linkedin social-icon"></a></li>
                <li><a href="https://www.youtube.com/channel/UCewPcqVy1lWm6kZSut6jF_w?view_as=subscriber" className="fab fa-youtube social-icon"></a> </li>
                <li><a href="https://www.instagram.com/dandre_campbell/" className="fab fa-instagram social-icon"></a></li>
            </ul>
            <ul className="pages-container">
                <li><a href="" className="page-tab">Home</a></li>
                <li><a href="" className="page-tab">About</a></li>
                <li><a href="" className="page-tab">Services</a></li>
                <li><a href="" className="page-tab">Projects</a></li>
                <li><a href="mailto:dandrecampbell5@gmail.com" className="page-tab">Contact</a></li>
            </ul>  
        </div>
    );
}

export default Nav;
